INSERT INTO Animes(AnimeID, AnimeTitle, AnimeDesc, TypeID, AiredBegin, AiredEnd, Premiered, Duration, PosterUrl) VALUES (219, CONCAT('Bishoujo Senshi Sailor Moon SuperS'), CONCAT('SuperS centers heavily on Chibi-usa and the Sailor Team. A new enemy, the Dead Moon Circus, has now appeared. Their motive is to find the Golden Dream Mirror that would be used to rule the world. To do this, the enemy attacks innocent victims for their Dream Mirrors and test their energy. Chibi-usa also has a new ally on her side, Pegasus. This season also sees the Sailor Senshi obtaining new powers. '), 1, '1995-03-04', '1996-03-02', 'Spring 1995', '24 min. per ep.', 'https://cdn.myanimelist.net/images/anime/1600/92253.jpg');
